// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

import './StellarToken.sol';
import './JamToken.sol';

contract TokenFarm {

    // declaraciones iniciales 
    string public name = "school token Stellar";
    address public owner;
    JamToken public jamToken;
    StellarToken public stellarToken;

    // estructuras de datos
    address [] public stakers;
    mapping(address => uint) public stakingBalance;
    mapping(address  => bool) public hasStaked;
    mapping(address  => bool) public isStaking;

    //constructor 
    constructor(StellarToken _stellarToken, JamToken _jamToken){
        stellarToken = _stellarToken;
        jamToken = _jamToken;
        owner = msg.sender;
    }

    // stake de tokens
    function stakeTokens(uint _amout) public {
        //se requiere superior a 0
        require(_amout > 0, "La cantidad no puede ser menor que 0");
        //transfer tokens JAM al smart contract principal
        jamToken.transferFRom(msg.sender, address(this), _amout);
        // actualizar el saldo de staking
        stakingBalance[msg.sender] += _amout;
        //guardar el staker
        if(!hasStaked[msg.sender]) {
            stakers.push(msg.sender);
        }

        // update el estado del staking
        isStaking[msg.sender] = true;
        hasStaked[msg.sender] = true;

    }

    // quitar el staking de los tokens 
    function unstakeTokend() public {
        // saldo del staking de un usuario
        uint balance = stakingBalance[msg.sender];
        // se requiere una cantidad superio a 0
         require(balance > 0, "El balance tiene que ser superiora 0");
         // transferencia de los tokens al usuario
         jamToken.transfer(msg.sender, balance);
         // resetea el balance de staking del usuario
         stakingBalance[msg.sender] = 0;
         // actualizar el estado del staking 
         isStaking[msg.sender] = false;
    }

    // emision de tokens (recompensas)
    function issueTokens() public {
        // unicamente ejecutando por el owner 
        require(msg.sender == owner, "no eres el owner");
        // emitir tokens a todod los stakers
        for(uint i=0; i < stakers.length; i++) {
            address recipient = stakers[i];
            uint balance = stakingBalance[recipient];
            if(balance > 0) {
                stellarToken.transfer(recipient, balance);
            }
        }
    }
}
